import React from 'react';
import { Redirect, withRouter } from 'react-router-dom';

const Resident = (props) => {
	const { history } = props;

	if (true) {
		return (
			<div>
				<Redirect to="/newResident" />
			</div>

		);
	} else {
		return (
			<div>
				<button>
					Retirar fondos
				</button>
				<button onClick={() => history.push("/edit")}>
					Editar datos
				</button>
			</div>

		);
	}
}

export default withRouter(Resident);
